{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/monishachoudhary/google-data-analytics-capstone-project-01?scriptVersionId=111859108\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"6ddec077","metadata":{"papermill":{"duration":0.013334,"end_time":"2022-11-23T13:32:16.763768","exception":false,"start_time":"2022-11-23T13:32:16.750434","status":"completed"},"tags":[]},"source":["# **Google Data Analytics - Capstone Project - 1**\n","\n","## **Case Study: How Does a Bike-Share Navigate Speedy Success?**\n"," \n","## **Introduction:**\n","In 2016, Cyclistic launched a successful bike-share offering. Since then, the program has grown to a fleet of 5,824 bicycles that are geotracked and locked into a network of 692 stations across Chicago. The bikes can be unlocked from one station and returned to any other station in the system anytime.\n","\n","Cyclistic’s marketing strategy relied on building general awareness and appealing to broad consumer segments. One approach that helped make these things possible was the flexibility of its pricing plans: single-ride passes, full-day passes, and annual memberships. Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who purchase annual memberships are Cyclistic members.\n","\n","As per analysis concluded by the finance team, it is found that customers holding membership ride provide more profit than casual riders. In spite of having a flexible plan, managing director believes that company’s key future growth depends on maximum no of annual memberships.\n","\n","Hence, **goal of this case study aims at providing a design marketing strategy in order to convert casual riders into annual membership riders.**\n"]},{"cell_type":"markdown","id":"53d7bfdf","metadata":{"papermill":{"duration":0.010693,"end_time":"2022-11-23T13:32:16.786031","exception":false,"start_time":"2022-11-23T13:32:16.775338","status":"completed"},"tags":[]},"source":["## Identifying stakeholders\n","* **Cyclistic:** A bike share program that has nearly 5800 bikes and 600 docking stations, which offers 3 type of bikes- hand bicylces, reclining bikes & cargo bikes, which could also help provide services to people with disabilities and to the people who cant stand on 2-wheeled bikes.\n","* **Lily Moreno:** Managing director of Cyclistic program, who is responsible for development of campaigns and initiative to promote the bike share program.\n","* **Cyclistic executive team:** are responsible for approving the recommendment marketing stratergy designed for the present case study."]},{"cell_type":"markdown","id":"a4480011","metadata":{"papermill":{"duration":0.010766,"end_time":"2022-11-23T13:32:16.80812","exception":false,"start_time":"2022-11-23T13:32:16.797354","status":"completed"},"tags":[]},"source":["## **Business task:**\n","* The case study aims at converting the casual rider users to membership rider users.\n","* With the datasets available from the companies database, we shall analyse the current datasets of CY-2021 and proceed with our analysis.\n","* Based on the historical data, we can analyse and compare our findings seperately for casual and annual membership holders and identify trends for the same.\n","* This could help us design a marketing strategy in order to boost profit of the company.\n","* We shall have our analysis, visualization and key finding presented to the stake holders along with recommendation."]},{"cell_type":"markdown","id":"34cc2af3","metadata":{"papermill":{"duration":0.01092,"end_time":"2022-11-23T13:32:16.832348","exception":false,"start_time":"2022-11-23T13:32:16.821428","status":"completed"},"tags":[]},"source":["## Data collection:\n","* Data have been collected from the reliable source. Datasets contain details about riders on monthly basis from Jan -2021 to Dec-2021.\n","* The datasets donot contain any information about customers private information such as debit card details or any payment detail, hence ensuring it to be maintained for privacy and crediblity.\n","* Datasets are of structure data type format with all datasets contained in .csv files.\n","* We shall use R Programming tool for data collection, manipulation and visualization in order to obtain insights from the analysis.\n","\n","### **Datasets can be accessed from the link- [Click here](https://divvy-tripdata.s3.amazonaws.com/index.html)**"]},{"cell_type":"markdown","id":"fa738511","metadata":{"papermill":{"duration":0.011079,"end_time":"2022-11-23T13:32:16.854399","exception":false,"start_time":"2022-11-23T13:32:16.84332","status":"completed"},"tags":[]},"source":["## Installing & loading packages in R"]},{"cell_type":"code","execution_count":1,"id":"46a34f41","metadata":{"execution":{"iopub.execute_input":"2022-11-23T13:32:16.883637Z","iopub.status.busy":"2022-11-23T13:32:16.879676Z","iopub.status.idle":"2022-11-23T13:35:09.944157Z","shell.execute_reply":"2022-11-23T13:35:09.942302Z"},"papermill":{"duration":173.083229,"end_time":"2022-11-23T13:35:09.949211","exception":false,"start_time":"2022-11-23T13:32:16.865982","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","also installing the dependency ‘timechange’\n","\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","also installing the dependencies ‘lifecycle’, ‘rlang’, ‘vctrs’\n","\n","\n","Warning message in install.packages(\"ggplot2\"):\n","“installation of package ‘rlang’ had non-zero exit status”\n","Warning message in install.packages(\"ggplot2\"):\n","“installation of package ‘lifecycle’ had