nd electric bikes types being the lowest.\n","* Casual riders rides more on weekends compared to weekdays, whereas membership riders rides more during the weekdays.\n","* Casual riders rides more on evening hours whereas lowesr during night hours.\n","* Membership riders rides more on Evening hours when compared to causal riders. \n","* Average duration of rides of casual riders are more than the membership riders."]},{"cell_type":"markdown","id":"5c6c2a78","metadata":{"papermill":{"duration":0.066044,"end_time":"2022-11-23T13:36:43.282793","exception":false,"start_time":"2022-11-23T13:36:43.216749","status":"completed"},"tags":[]},"source":["### **Recommendation**\n","\n","* Membership riders on weekends can be provided with special offers, discounts or copouns, along with flexible pricing plan which is available presently.\n","* To make rides to be economic friendly, no of bikes of electric bike type can be increased and be kept accessed at maximum frequently used dockstations.\n","* Since no of rides have been found to be less during winter seasons, special offers can be added during those seasons for memberships riders, in order to boost the ride numbers.\n","* Customer feeback surveys can collected for their experience of use as casual and membership riders and analysed for further investigation."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":271.846937,"end_time":"2022-11-23T13:36:43.872526","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-11-23T13:32:12.025589","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}